import React,{Component} from 'react';
class User extends Component{
    render(){
        return(

            <div>
            <div className="header">
            <div onClick={window.history.go(-1)}>取消</div>
            登陆
            </div>
            <Link to="/register">注册</Link>
            </div>
        )
    }
}
export default User;
